import React from 'react'
import axios from 'axios'

class CompanyGraph extends React.Component{
    constructor(){
        super()
        this.state = {
          partners:this.props.currentCompany
        }
      }
    componentDidMount(){
        const api = axios.create({
          baseURL: 'http://localhost:9200/proto/_search?q=id:100'
        })
        api.get('')
          .then(async(res) => {
            console.log(this.props.currentCompany.nature)
            this.setState({others:res.data.hits.hits})
        });
    }
    render(){
        return(
            <div>{this.state.partners}</div>
        )
    }
}

export default CompanyGraph
